package com.hosv3.gui.component.nan;//import com.hospital_os.utility.XPersistent;import com.hospital_os.usecase.connection.CommonInf;public class RiskFactorTemplate extends DiseaseTemplate implements  CommonInf{    public RiskFactorTemplate()    {         super();    } public RiskFactorTemplate(DiseaseTemplate dt)    {        setObjectId(dt.getObjectId());        pk_field = dt.pk_field;        table = dt.table;        name=dt.name;        note=dt.note;           }    public String getCode() {        return this.getObjectId();    }        public String getName() {        return this.name;    }    public String toString(){        return getName();    }}